import { HttpClient } from "../network/http";

import { User } from "../types/user";

class userService extends HttpClient {
  async testing(data: FormData) {
    try {
      return await this.axiosFetch<string>("/test", {
        method: "post",
        body: data,
      });
    } catch (err) {
      throw err;
    }
  }

  // 유저 정보 겹치는것 체크
  async OverlapCheck(data: FormData) {
    try {
      return await this.axiosFetch<boolean>("/overlap_check", {
        method: "post",
        body: data,
      });
    } catch (err) {
      throw err;
    }
  }
  // 유저정보 보내기
  async sendUserInfo(data: FormData) {
    try {
      return await this.axiosFetch<void>(`/user_info`, {
        method: "post",
        body: data,
      });
    } catch (err) {
      throw err;
    }
  }
  // 인증코드 재전송
  async resendAuthcode(data: FormData) {
    try {
      return await this.axiosFetch<boolean>("/send_authcode", {
        method: "post",
        body: data,
      });
    } catch (err) {
      throw err;
    }
  }
  // 인증번호 확인
  async checkAuthcode(data: FormData) {
    try {
      return await this.axiosFetch<boolean>("/authcode_check", {
        method: "post",
        body: data,
      });
    } catch (err) {
      throw err;
    }
  }

  async sendLoginInfo(data: FormData) {}
}

export const user_service = new userService();
